import React, { Component } from 'react';
import './App.css';
import NewsZoom00 from './components/NewsZoom00';
import { BrowserRouter, Route } from "react-router-dom";


class App extends Component {
  render() {
    return (
      <div className="App">
      <BrowserRouter>
        <Route path="/NewsZoom00" component={NewsZoom00}/>


      </BrowserRouter>
      </div>
    );
  }
}

export default App;
